var panzoom = require('panzoom');
export default function() {
	console.log('ddd')




	var element = document.getElementById('map');
	console.log(element)
	if (element) {
		console.log('aaaa')
		panzoom(element, {
			smoothScroll: false,
			bounds: true,
			boundsPadding: 0.1,
			maxZoom: 4,
			minZoom: 0.8
		});
	}
}
